def fib(n):
    a, b = 1, 1
    for _ in range(n-1):
        a, b = b, a+b
    return a
print([fib(i) for i in range(1,11)])

def lucas(n):
    a, b = 2, 1
    for _ in range(n-1):
        a, b = b, a+b
    return a
print([lucas(i) for i in range(1,11)])

def is_prime(n):
    if n < 2: return False
    for i in range(2, int(n**0.5)+1):
        if n % i == 0: return False
    return True
print([x for x in range(2,30) if is_prime(x)])

def is_semiprime(n):
    factors = 0
    for i in range(2, n+1):
        while n % i == 0:
            factors += 1
            n = n // i
            if factors > 2: return False
    return factors == 2
print([x for x in range(4,30) if is_semiprime(x)])

def is_mersenne_prime(p):
    if not is_prime(p): return False
    m = 2**p - 1
    return is_prime(m)
print([2**p-1 for p in [2,3,5,7,13,17,19,31,61,89] if is_prime(p)])

